import React, { Component } from 'react'

export default class Phones extends Component {
    render() {
        const phoneItems = this.props.phones.map( phone => (
         <div className="col-md-6">
             <div className="thumbnail text-center">
                <a href={`#${phone.id}`}  onClick={this.props.handleAddCharacteristics}>
                    <img src={`/phones/${phone.imageFilename}.toString()`} alt={phone.name}/>
                    <p>
                        {phone.name}
                    </p>
                </a>
            </div>
         </div>   )

        )

        return (
            <div className="row">
                {phoneItems}
            </div>
        )
    }
}
